The device supports the data sharing with Apple's Health App. Authorized user can obtain data from your BBT, ovulation test, sexual behavior, menstruation, petechial hemorrhage, the quality of cervical mucus, sleep analysis, height and weight, so as to have a more comprehensive understanding of your health status.

What could smart Himama pregnancy preparation assistant do for you?
[Finding the ovulatory date to determine the best timing for pregnancy] Input your body temperature, then you will immediately know the status of your ovulation of that day.
[Earlier detection of pregnancy, superior to any LH kit] Automatically detecting whether you are pregnant 18 days after conception.
[Earlier diagnosis of gynaecopathia, earlier detection for earlier treatment] Reminding of corpus luteum problems or ovulation disorders.
[Sleep monitoring for eugenics] Monitoring on total length of sleep and length of deep sleep all night.

Core functions of smart Himama pregnancy preparation doctor:
1. Reporting ovulation everyday: telling you whether you are ovulating, the likelihood of pregnancy and your high/low temperature zone based on your BBT of the day;
2. Drawing up BBT curve automatically, to intelligently observe the status of pregnancy;
3. Cause analysis on the difficulties in getting pregnant: reminding of and analyzing on corpus luteum problems or ovulation disorders;
4. Sleep monitoring: monitoring the accumulated length of sleep, length of deep/light sleep; determining the quality of sleep, and monitoring the time of going to sleep and waking up;

Stork guides you through pregnancy day-by-day and week-by-week. Based on your due date, you will receive personalized information, the latest parenting news, and health information. 
You will get tools to help you prepare and feel in control every step of the way – helping you achieve a happy, healthy pregnancy.

To get started, simply enter your baby's due date. All health content is based on information from experts, so you can feel confident and prepared for the changes to your baby and body. 

Explore helpful pregnancy tools like baby size and weight visualizer, contraction timer, pregnancy weight chart, hospital bag list, and newborn shopping list. 

